// https://leetcode.cn/problems/robot-in-a-grid-lcci/?favorite=xb9lfcwi

func pathWithObstacles(obstacleGrid [][]int) [][]int {
	ret := make([][]int, 0)

	lines := len(obstacleGrid)
	if lines == 0 {
		return ret
	}
	rows := len(obstacleGrid[0])
	if rows == 0 || obstacleGrid[0][0] == 1 {
		return ret
	}
	helper := make(map[int]bool)
	var recursion func(x, y int) bool
	recursion = func(x, y int) bool {
		n := (x-1)*rows + y
		if flag, ok := helper[n]; ok {
			return flag
		}
		ret = append(ret, []int{x, y})
		if x == lines-1 && y == rows-1 {
			helper[n] = true
			return true
		}
		// 向下
		if x+1 < lines && obstacleGrid[x+1][y] == 0 {
			if recursion(x+1, y) {
				helper[n] = true
				return true
			}
		}
		// 向右
		if y+1 < rows && obstacleGrid[x][y+1] == 0 {
			if recursion(x, y+1) {
				helper[n] = true
				return true
			}
		}
		ret = ret[:len(ret)-1]
		helper[n] = false
		return false
	}
	recursion(0, 0)
	return ret
}

